import React from 'react';
import { Link } from 'react-router-dom';

const TabBar = () => {
  return (
    <div className="TabBar">
      <ul className="list-inline">
        <li><Link to="#">Coches</Link></li>
        <li><Link to="#">Packages</Link></li>
        <img src="/images/Sorting.png" alt="" className="ImgSorting"/>
        <div className="SearchBar">
          <input type="text" className="form-control Input" placeholder="" id="mail" name="e" />
        </div>
        {/* <img src="/images/Search.png" alt="" className="ImgSearching"/> */}
      </ul>
    </div>
  );
};

export default TabBar;
